package au.com.lingvo.domain;import javax.persistence.*;@Entitypublic class ProfileInterestLanguage {    @Id    @GeneratedValue(strategy = GenerationType.AUTO)    private long id;    @ManyToOne    @JoinColumn(name = "language_id")    private InterestLanguage interestLanguage;    @Enumerated(EnumType.STRING)    private LanguageLevel languageLevel;    public InterestLanguage getInterestLanguage() {        return interestLanguage;    }    public void setInterestLanguage(InterestLanguage interestLanguage) {        this.interestLanguage = interestLanguage;    }    public long getId() {        return id;    }    public void setId(long id) {        this.id = id;    }    public LanguageLevel getLanguageLevel() {        return languageLevel;    }    public void setLanguageLevel(LanguageLevel languageLevel) {        this.languageLevel = languageLevel;    }}